          <button type="submit" onSubmit = {() => props.onSwitch("Phone")} > Send </button>
		  
		   {/* <button  className="send-btn"  type="submit"  onChange={() =>  props.onFormSwitch("loginForm")}>Send</button> */}

		 </form>
		<button className="link-btn" type="submit" onChange={(form) =>  props.onFormSwitch("Phone")} > Use phone instead </button>
    
         </div>
      
        
    )
}
export default Register;
